import React, { lazy } from 'react'
import Loadable from 'app/components/Loadable/Loadable';
const Test = Loadable(lazy(() => import("./Test")));

const metricsRoutes = [
    {
        path: '/metrics/test',
        element: <Test />,
    }
]

export default metricsRoutes
